Identificador de Licencia, siendo un identificador globalmente único para una licencia o contrato bajo el cual los artículos son generados, enviados para procesamiento y/o pagados, que se construye concatenando:
 - un código de agencia emisora ISO/IEC 15459;
 - un número de licencia o contrato que se ajusta a las especificaciones de la agencia emisora concerniente;
 y que:
 - comprende solo caracteres alfabéticos en mayúscula y/o numéricos;
 - es único (es decir, es distinto de cualquier otro identificador conforme a ISO/IEC 15459) dentro del dominio de la agencia emisora;
 - no puede ser derivado de ningún otro identificador conforme a ISO/IEC 15459, emitido bajo la misma agencia emisora, por la simple adición de caracteres a, o su eliminación de, su extremo.

Código de área de pesca de la FAO según lo definido por el Departamento de Pesca y Acuicultura de la FAO (http://www.fao.org. Buscar el sub-sitio Código de Área de Pesca).
Se permiten todos los caracteres del subconjunto definido por las Especificaciones Generales de GS1 de ISO/IEC 646.
