Código de Ubicación '26L', siendo un código que identifica una ubicación o área geográfica, o un grupo asociado de dichas ubicaciones o áreas, que tiene relevancia para una transacción relacionada y que cumple con una de las estructuras definidas en (a) a (f) a continuación:
a) dos caracteres alfabéticos en mayúsculas correspondientes al código de país ISO 3166-1 de dos alfas del país en el que, o que consiste en, están situadas las ubicaciones o áreas;
b) tres caracteres alfabéticos en mayúsculas correspondientes al código IATA del aeropuerto o ciudad en, cerca de, o que consiste en, están situadas las ubicaciones o áreas;
c) cuatro o más caracteres de los cuales los primeros tres corresponden a un código de país ISO 3166-1 seguido por un guion (-), con el resto siendo un código postal en el país concerniente;
d) cuatro o más caracteres de los cuales los primeros tres corresponden a un código de país ISO 3166-1 seguido por un punto (.), con el resto siendo un código de subdivisión de país ISO 3166-2 en el país concerniente;
e) cinco caracteres alfabéticos en mayúsculas correspondientes al UN/LOCODE del área en, cerca de, o que consiste en, están situadas las ubicaciones o áreas;
f) la concatenación, siendo no menos de siete ni más de 35 caracteres de longitud, de:
- un código de agencia emisora ISO/IEC 15459;
- un código de ubicación, consistiendo en caracteres extraídos del conjunto {A-Z; 0-9} que se ajusta a las especificaciones de la agencia emisora concerniente.

