Identificador de equipo, siendo un identificador globalmente único para un dispositivo, un artículo de equipo o instancia de una aplicación de computadora utilizada en la producción, transporte, procesamiento u otro manejo de artículos.

Código de Ubicación UPU, siendo un código que identifica una ubicación o área geográfica, o un grupo asociado de tales ubicaciones o áreas, que tiene relevancia para una transacción relacionada y que cumple con una de las estructuras definidas en a) a g) a continuación:
a) dos caracteres alfabéticos en mayúsculas correspondientes al código de país alfa 2 ISO 3166-1 del país en el que, o consistiendo en el cual, se sitúan la(s) ubicación(es) o área(s);
b) tres caracteres alfabéticos en mayúsculas correspondientes al código IATA del aeropuerto o ciudad en, cerca de, o consistiendo en el cual, se sitúan la(s) ubicación(es) o área(s);
c) cuatro o más caracteres de los cuales los primeros tres corresponden a un código de país ISO 3166-1 seguido por un guion (-), con el saldo siendo un código postal en el país concerniente;
d) cuatro o más caracteres de los cuales los primeros tres corresponden a un código de país ISO 3166-1 seguido por un punto (.), con el saldo siendo un código de subdivisión de país ISO 3166-2 en el país concerniente;
e) cinco caracteres alfabéticos en mayúsculas correspondientes al UN/LOCODE del área en, cerca de, o consistiendo en el cual, se sitúan la(s) ubicación(es) o área(s);
f) seis caracteres alfanuméricos en mayúsculas correspondientes a un código IMPC UPU asignado de acuerdo con el estándar UPU S34;
g) la concatenación, siendo no menos de siete ni más de 25 caracteres de longitud, de:
 - un código de emisor asignado de acuerdo con los estándares UPU S31;
 - un código de ubicación, consistiendo en caracteres tomados del conjunto {A-Z; 0-9} que cumple con las especificaciones del emisor concerniente.

Placa de Matrícula con Datos de Servicio y Código de Ubicación es una construcción de datos compuesta, conforme con la especificación en el estándar UPU S25, que incluye especificación de:
 - un identificador de artículo conforme a ISO/IEC 15459;
 - una especificación conforme a 5U del servicio a proporcionar con respecto al artículo;
 - un código de ubicación UPU conforme a 17U o un código de ubicación UPU calificado conforme a 18U.
 Nota - Para más detalles, por favor consulte el estándar UPU S25. La distinción entre un código de ubicación UPU simple (DI 17U) y un código de ubicación UPU calificado (DI 18U) se puede determinar a partir del primer carácter. Si este es numérico, se aplica 18U; si es alfabético, se aplica 17U.

Evento, Fecha y Hora.
Formato ISO YYYYMMDDHHMM (reloj de 24 horas - UTC) seguido inmediatamente por un Calificador de Código UN/EDIFACT 2005 proporcionando un código especificando tipo de fecha), por ejemplo,
11 [Fecha en que se espera que las mercancías sean despachadas/enviadas cuando se emite el mensaje.];
17 [Fecha/hora estimada de entrega cuando se espera que las mercancías sean entregadas];
35 [Fecha en que las mercancías son entregadas a su destino.];
118 [Reserva Confirmada];
129 [Fecha en que el buque/mercancía partió del último puerto extranjero en el país exportador.];
132 [Fecha/hora en que el transportista estima que un medio de transporte debería llegar al puerto de descarga o lugar de destino.];
133 [Fecha/hora en que el transportista estima que un medio de transporte debería partir en el lugar de salida];
137 [Fecha/hora en que el proveedor envía partes basado en la solicitud del cliente. (Fecha en que se emite el mensaje DESADV. Se recomienda que el DESADV se emita dentro de los 30 minutos de que las mercancías sean recogidas en la parte ShipFrom];
146 [Fecha Estimada de Entrada (Aduanas) fecha en que se anticipa la fecha oficial de una Entrada Aduanera.];
151 [Fecha de Importación (Llegada al puerto con intención de desembarcar];
186 Sale de una Instalación ('Salida de Puerta)];
204 [Fecha en que la Aduana libera la mercancía al transportista o importador];
253 [Sale de un Puerto ('Salida de Buque')];
252 [Llega a un Puerto ('Llegada de Buque')];
283 [Llega a una Instalación ('Entrada a Puerta)];
342 [Carga de Conveyance];
351 [Inspección de Puerta de Terminal];
411 [Ordenado Rellenado];
412 [Ordenado Desempacado];
420 [Descarga de Conveyance];
534 [Reparado];
677 [Rellenado Confirmado];
678 [Desempacado Confirmado];
696 [Fecha de Presentación].

Fecha, representada en forma modificada conforme a UTC:
yyyy[mm[dd[hh[mm[ss[fff]]]]]][poooo] donde los corchetes indican opcionalidad y yyyy es el año, mmdd el mes y día, hhmmss la hora del día en horas minutos y segundos, fff las fracciones de secciones y poooo el desfase de UTC expresado en horas y minutos, el desfase siendo positivo si p es un punto (.), negativo si P es un signo menos (-).
EJEMPLO:
2005 - (UTC) año calendario 2005;
200505 - (UTC) mes calendario Mayo 2005;
20050518 - (UTC) 18 de Mayo de 2005;
200505181247 - 12:47 UTC el 18 de Mayo de 2005;
200505181247.0100 - 12:47 hora local, siendo 11:47 UTC, el 18 de Mayo de 2005;
20050518124723099 - 99 milisegundos después de las 12:47:23 UTC el 18 de Mayo de 200.

Fecha Calificada, compuesta por la concatenación de:
- un código de agencia emisora ISO/IEC 15459;
- un calificador de fecha conforme a las especificaciones de esa agencia emisora;
- una fecha cuyo formato e interpretación cumplen con las especificaciones de la agencia emisora para ese calificador de fecha.

Declaración de Categoría de Material de Embalaje*, Código* y Peso para un material de embalaje dado utilizado en un embalaje dado según la directiva de la UE sobre embalajes y residuos de embalajes. (Categoría de material y código definidos en el Anexo M).
12ECCMMMMMMNNNNNUU donde: - '12E' (an3) es el Identificador de Datos;
 - 'CC' (n2) es la Categoría de Material según el Anexo M;
 - 'MMMMMM' (an1...6) es el Código de Material según el Anexo M;
 - 'NNNNN' (n5) Peso del Material, incluyendo punto decimal (por ejemplo, 12.12);
 - 'UU' (an2) es la Unidad de medida para el peso (por ejemplo, KG, GR, LB o OZ según ANSI X12.3 como en el Anexo D).

