Número de Consignatario.
El número identificador único puede ser el IRS, EIN, SSN, o el número asignado por CBP, según lo requerido en la Presentación de Seguridad. Solo se deben utilizar los siguientes formatos: IRS EIN: NN-NNNNNNN;
IRS EIN con sufijo:
NN-NNNNNNNXX;
SSN: NNN-NN-NNNN;
Número asignado por CBP: YYDDPP-NNNNN.
